import React from 'react';
import {useSelector} from 'react-redux';

export default function Shopping(){

  const cart = useSelector(state => state.cart)
  console.log(cart)



  return (
      <div style={panelStyle}>
          <h2>
              Shopping
          </h2>


           <table>
           {cart.map((item) => (
              <tr key={item.id}>
                  <td>{item.name}</td>
                  <td>{item.price}</td>
                  <td>{item.qty}</td>
              </tr>
                  ))}
            </table>
         </div>
  )
}

const panelStyle = {
  padding: "10px",
  height: "100vh",
  width: '50vw',
  background: '#FFC107',
}
